  KEY `email` (`email`),
  CONSTRAINT `Publica_ibfk_1` FOREIGN KEY (`idIncidencia`) REFERENCES `Incidencia` (`id`),
  CONSTRAINT `Publica_ibfk_2` FOREIGN KEY (`email`) REFERENCES `Usuario` (`email`)
